    count:0
  }
incrementMe = ()=> {
  console.log("give some likes")
}
}

function   MoodType(props) {
  const { Name, image, Feeling } = props
  return (
    <div className="MoodType">
      <img
        src={`${process.env.PUBLIC_URL}images/${image}`}
        width="300"
        height="300"
        alt="Hello"
      />
      <h1 id="name">{Name}</h1>
      <div id="feeling">{Feeling}</div>
      <button onClick={this.incrementMe}> Likes: {this.state.count}</button>
    </div>
  )
}

export default MoodType
